import img1 from "./Images/bg12.jpg";
import img2 from "./Images/cover2.jpg";
import img3 from "./Images/mywork.png";
import img4 from "./Images/tree.jpg";

const mydiv = [
  { id: "1", title: "This is the 1st Image", src: img1 },
  {
    id: "2",
    title: "This is the 2nd Image",
    src: img2,
  },
  { id: 3, title: "This is the 3rd Image", src: img3 },
  {
    id: 4,
    title: "This is the 4rth Image",
    src: img4,
  },
];

export default mydiv;
